import React,{Component} from 'react';
import  './myTablestyle.css';

class MyTable extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className = "datalist">
                <div className="title" >国内各地区疫情统计汇总</div>
                <div className="data">
                       <ul>
                            <li>
                                <span>疫情地区</span>
                                <span>新增</span>
                                <span>现有</span>
                                <span>累计</span>
                                <span>治愈</span>
                                <span>死亡</span>
                            </li>
                            {
                                props.feiyanChanalist.map((item, index)=>{
                                    return (
                                        <li>
                                            <span>北京</span>
                                            <span>0</span>
                                            <span>120</span>
                                            <span>34</span>
                                            <span>12</span>
                                            <span>0</span>
                                        </li>
                                    )
                                })
                            }
                            
                        </ul>
                </div>
            </div>
        )
    }
    
}

export default MyTable;
